    "description":
        "Aarkyat Fort is located close to the north-west coastal area of Qatar along the road between Zubarah and Madinat Al-Shamal. The exact date of the original construction is unknown but coins and other artefacts found on the site date the fort back to at least 200 years sometime during the 18th century. Ruins of buildings at the nearby Zubarah town indicate that it was a thriving place by 1765 and evidence suggests that Aarkyat Fort dates back to the same period. The name Aarkyat means ''water wells'' (the plural form in Arabic), so it was likely that Aarkyat Fort was built to protect sources of water. There was in fact a water well at the fort that was 5 metres deep. There are ruins of a village close to the fort so there is no doubt that the fort was intended to protect the local inhabitants' water supply. Aarkyral Fort is roughly rectangular in shape measuring approx. 22 metres x 38 metres with corner turrets extending 2 to 3 metres beyond these dimensions. It is laid out in a typical military fort style with narrow rooms arranged in linear fashion around three sides in a large central sand/earth courtyard. The only entrance is a 2.8 metre break in the one metre-thick wall. The exterior walls surrounding Aarkyat Fort are relatively low as military forts go - averaging about 3 metres high. Another striking feature of the fort is the total absence of architectural ornamentation - it is very plain, unadorned, utilitarian structure making it a classic piece of straightforward military architecture. The only distinctive feature of the fort is the crenellated circular turret at the south-west corner, which is slightly more than 7.5 metres in diameter rising about a metre higher than the adjacent west exterior wall and 2 metres higher than the south wall - there are three rectangular turrets at the three other corners of the fort. Each fort each has one or more very small square openings (less than .2 metres wide) situated on their upper extent which although primarily intended to be used as gun holes also allow air and light to enter the turrets' interior. All the turrets (except the south-eastern one) can be accessed by an outside stairway. Strangely the north-eastern stairway only arrives halfway up the wall. About a dozen rooms align three sides of the courtyard none of which have windows. The larger rooms were used as a barracks for soldiers whereas the smaller rooms were used for the storage ammunition and other goods. Just outside the main entrance, adjacent to the large circular turret at the south-western corner, there is a Mosque. The existing shape of the fort seems to be the result of an expansion of the original fort, doubling the size of the courtyard to it's present size. The remains of the original walls can still be seen stretchin acorss the middle of the courtyard and the clear remains of walls, that used to line the east wall, are still visible. The fort was constructed using traditional materials, primarily horizontal layers of rock, covered over with thick layers of mud plaster. Some walls particularly along the front are constructed with adobe brick which is not commonly used in Qatar despite its greater strength and durability. The roof over the courtyard rooms are all constructed using the traditional ''Danshal'' wood beams, overlain with ''Basgiil'' and ''Mangharour'' all of which are overlain with a layer of rocks and then a layer of mud plaster ''tanqa al-tin'' There are Marsams along the outer parapet walls. The fort was renovated in 1988 after falling into a serious state of ruin (photographs from 1974 show the fort in a badly decayed state). Survey 2011 (HAC71) This site comprises the fort and an adjacent mosque. The fort has a rectangular plan and three rectangular towers and one round tower. There are two courtyards one to the east and one to the west divided by a range of rooms. It is not clear whether originally this was a square fort that was later extended or whether the courtyard was divided intwo by later development. Unfortunately because the fort has been thoroughly restored it is not possible to determine the sequence of construction. Groundtruthing 2011 (HAC40): Restored fort. Limestone and mudbrick construction. Three square towers and one round tower/ small camel farm adjacent. Earlier, unrestored walls visible inside and in front of restored fort. Ceramics recovered: SU 528.",
