    "description":
        "Settlement site, at least partially ruined and abandoned. Substantial number of structures visible. Ain Mohammed is located 4km from Al Zubarah. The village dates from the 19th century but it is now abandoned and in ruins. The buildings in the village are totally in ruins, with little left of their former architecture and structure. There is northing remaining to show the basic design, apart from some low piles of rocks that suggest walls. Groundtruthing 2011 (HAC40); 20th century abandoned settlement. Probably abandoned in the late 20th century. Most buildings with walls standing to their original height. Modern building material used in most houses. Probably associated with cemetery (QNHER10190). Number of wells associated with this settlement. Groundtruthing 2010 (HAC40): Site 10192 is identified as an abandoned village; Ain Mohammed. The village consists of 24 buildings including 2 mosques. Due to the variety of building material and building styles it is suggested that the village holds 3 different types of buildings and hence suggests 3 different periods of construction. Building type 1 is made of concrete breeze blocks filled with compact sandy beach soils with walls covered with mud plaster - the roof is either flat or pointed. Building type 2 is made of stones and mud plaster covering the walls with either flat or pointed roof and what seemed to be window and door frames made with breeze blocks. Building type 3 seems to resemble building type 2 with stones and mud plastering but, as the majority of these houses have collapsed, it is impossible to make clear suggestions concerning roof etc. The village also holds a courtyard fenced with a stone wall with walls still standing at a maximum height of 77cm. In the courtyard is a smaller orchard or field system and a well with the pump in situ. In the outer courtyard there is an outline of a tent set up with rock with petroglyphs as seen on the aeolionit sand dunes of survey zone 1. The tent set up has a possibe 'prayer# niche. The 2 mosques represent 2 different building types, 1 & 3. Roof seems to be made of timber. Dimensions: Approx extent of site: 49,722.75sq.m. 287m long - NS orientation 173.25m wide - EW orientation",
